import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    {
      this.state = {
        title: "ABDULLAH ZAHID",
        headerLinks: [
          { title: "Home", path: "/" },
          { title: "About", path: "/" },
          { title: "Contact", path: "/" },
        ],

        home: {
          mainHeader: "Nothing != Impossible",
          subHeader: "Solving Problems through Programming",
          subText: "Check it out below!",
        },
        About: {
          mainHeader: "Me",
        },
        Contact: {
          mainHeader: "Connect with me",
        },
      };
    }
  }
  render() {
    return <div>YO</div>;
  }
}
export default App;
